import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('cache', () => {
    test('ok', async () => {
        const r1 = await request('http://cache.test.whistlejs.com/index.html');
        expect(r1.res.headers).toHaveProperty('cache-control', 'max-age=60000');
        const r2 = await request({
            method: 'post',
            url: 'https://cache.test.whistlejs.com/index.html'
        });
        expect(r2.res.headers).toHaveProperty('cache-control', 'max-age=60000');
    });
});
